import React, { useState } from 'react';
import './style.css';
import GoogleApps from './../../components/GoogleApps/index';

export function ToggleApps() {
  const [show, setShow] = useState(true)

    return ( <>
      <li>
        <button onClick={() => setShow(!show)} className="settings" alt="Settings">
            <GApps />
        </button>
        {
        show? null : <GoogleApps/>
        }
      </li>
    </> )
}

const GApps = () => (
    <li>
        <button className="gapps-icon-link" href="#" alt="Google apps" data-title="Google apps">
